import './App.css';
import Navigationbar from './components/navigation/navigationBar';
import React from "react";
function App() {
  return (
    <div className="App">
      {Navigationbar()}
      <div className='Home_videoContainer'>
        <div className='filter'></div>
        <video  >
          <source src='./assets/hero.mp4'></source>

        </video>

      </div>
    </div>
  );
}

export default App;
